  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Klamath
  Basin National Wildlife Refuge Complex outlines Refuge accomplishments during the
  1989 calendar year. The Tule Lake National Wildlife Refuge report begins with a
  summary of the year's highlights and weather conditions. Land acquisition is covered.
  The report includes a planning section which discusses management planning and research
  and investigations. Refuge administration is outlined; information about personnel,
  other manpower programs, volunteer programs, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, croplands,
  grasslands, other habitats, grazing, haying, fire management, and pest control.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, other
  resident wildlife, scientific collections, animal control, marking and bird banding,
  and disease prevention and control. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive programs, hunting, wildlife observation,
  other wildlife oriented recreation, picnicking, off-road vehicles, and law enforcement.
  The equipment and facilities section of the report provides information about equipment
  utilization and replacement and  communication systems. Cooperative programs are
  provided at the end. Refuge brochures and field guides are attached. Narrative reports
  for Lower Klamath, Clear Lake, Upper Klamath, Klamath Forest, and Bear Valley National
  Wildlife Refuge are included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
